var routesStyle = {
	color: "#FF0000",
	opacity: 1,
	weight: 5,
}

var nychaStyle = {
	color: "#D9D3C4",
	fillColor: "#D9D3C4",
	fillOpacity: .5,
	opacity: 0,
	weight: 2
};

var connectorStyle = {
	color: "#FF7F00",
	opacity: 1,
	weight: 10,
	dashArray: "1,15",
	lineCap: "square"
};

var schoolsStyle = {
	color: "#FF0000",
	fillColor: "#A3BAD2",
	fillOpacity: 0.75,
	opacity: 1,
	weight: 0
};

var devProjectsStyle = {
	color: "#FF0000",
	fillColor: "#000000",
	fillOpacity: 0.1,
	opacity: 1,
	weight: 2.5
};

L.geoJson(routes, {
	style: function(feature){
		switch (feature.properties.VALUE){
			case 1: return {
				color: "#00DBFF",
				opacity: 1,
				weight: 3
			};
			case 0: return {
				color: "#FF0000",
				opacity: 1,
				weight: 3
			};
		}
	},
	onEachFeature: function (feature, layer){
		if(feature.properties.NOTES != null){
			layer.bindPopup(feature.properties.NOTES)
		}
		else{}
	}
}).addTo(map);

L.geoJson(comments, {
	style: function(feature){
		switch (feature.properties.VALUE){
			case 1: return {
				fillColor: "#00DBFF",
				color: "#00DBFF",
				opacity: 1,
				fillOpacity: 0.5,
				radius: 10,
				weight: 1
			};
			case -1: return {
				fillColor: "#FF0000",
				color: "#FF0000",
				opacity: 1,
				fillOpacity: 0.5,
				radius: 10,
				weight: 1
			};
			default: return {
				fillColor: "#999999",
				color: "#999999",
				radius: 6,
				opacity: 1,
				weight: 1,
				fillOpacity: 1
			};
		}
	},
    pointToLayer: function(feature, latlng) {
        return L.circleMarker(latlng, {
        });
    }
}).addTo(map);

L.geoJson(comments, {
	style: function(feature){
		switch (feature.properties.VALUE){
			case 1: return {
				fillColor: "#00DBFF",
				color: "#00DBFF",
				opacity: 1,
				fillOpacity: 0.35,
				radius: 6,
				weight: 1
			};
			case -1: return {
				fillColor: "#FF0000",
				color: "#FF0000",
				opacity: 1,
				fillOpacity: 0.35,
				radius: 6,
				weight: 1
			};
			default: return {
				fillColor: "#999999",
				color: "#999999",
				radius: 6,
				opacity: 1,
				weight: 1,
				fillOpacity: 1
			};
		}
	},
    pointToLayer: function(feature, latlng) {
        return L.circleMarker(latlng, {
        });
    },
    onEachFeature: function (feature, layer) {
        layer.bindPopup(feature.properties.NOTES);
    }
}).addTo(map);

L.geoJson(connector, {
	style: connectorStyle,
	onEachFeature: function(feature, layer){
		layer.bindPopup("Randall's Island Connector")
	}
}).addTo(map);

L.geoJson(schools, {
	style: schoolsStyle
}).addTo(map);

L.geoJson(nycha, {
	style: nychaStyle
}).addTo(map);

L.geoJson(devProjects, {
	style: devProjectsStyle,
	onEachFeature: function (feature, layer){
		layer.bindPopup("<b>"+feature.properties.Developer+"</b>"+ "<br />" + feature.properties.Name + "<br />" + feature.properties.Size + "<br />" + feature.properties.Date);
	}
}).addTo(map);